import React from 'react';
import { PortHead } from './components/header';
// import { Link } from 'react-router-dom';

import { Main, Img, Tit, ProH } from './components/components';

export const Yape = () => (
	<main>
		<PortHead />

		<ProH
			title="Yape"
			subtitle="immagine coordinata - 2018"
			class="whale"
		>
			<video src="../img/yape/yape.mp4"></video>
		</ProH>
		<Main>
			<div className=" bg-light-gray z-1 w-100 mb7">
				<div className="flex w-100 flex-column-m justify-between z-2 ">
					<div className="optima pa4 f3 fw4 z-3">Schemi preparatori</div>
					<Img src="../img/yape/yapetype.jpg" class=" ma4 w-60 b--white ba bw5" />
				</div>
			</div>
		</Main>
	</main>
);
